  },
  {
    id: 20,
    title: "Digital Dusk",
    artist: "Techno Twilight",
    genre: "Electronic",
  },
];

const tempPlaylist = [
  {
    id: 1,
    title: "Song 1",
    artist: "Artist A",
    genre: "Pop",
    rating: 4,
  },
  {
    id: 2,
    title: "Song 2",
    artist: "Artist B",
    genre: "Rock",
    rating: 5,
  },
];
function App() {
  const [query, setQuery] = useState("");
  const [musics, setMusic] = useState(tempMusicData);
  const [playlist, setPlaylist] = useState(tempPlaylist);
  const [filter, setFilter] = useState("all"); // State for filter criteria
  const [sortBy, setSortBy] = useState("title"); // State for sort criteria

  const addToPlaylist = (music) => {
    setPlaylist([...playlist, music]);
  };
  // Apply filter and sort criteria to music data
  const filtered = musics
    .filter((music) => {
      // Apply filter criteria
      if (filter === "all") return true;
      if (filter === "pop") return music.genre === "Pop";
      if (filter === "rock") return music.genre === "Rock";
      if (filter === "jazz") return music.genre === "Jazz";
    })
    .filter((music) => {
      // Apply search query
      return music.title.toLowerCase().includes(query.toLowerCase());
    })
    .sort((a, b) => {
      // Apply sorting criteria
      if (sortBy === "title") {
        return a.title.localeCompare(b.title);
      } else if (sortBy === "artist") {
        return a.artist.localeCompare(b.artist);
      } else if (sortBy === "genre") {
        return a.genre.localeCompare(b.genre);
      }
    });

  return (
    <div>
      <Header musics={filtered} query={query} setQuery={setQuery} />
      <div>
        <label>
          Filter by Genre:
          <select value={filter} onChange={(e) => setFilter(e.target.value)}>
            <option value="all">All</option>
            <option value="pop">Pop</option>
            <option value="rock">Rock</option>
            <option value="jazz">Jazz</option>
          </select>
        </label>
        <label>
          Sort by:
          <select value={sortBy} onChange={(e) => setSortBy(e.target.value)}>
            <option value="title">Title</option>
            <option value="artist">Artist</option>
            <option value="genre">Genre</option>
          </select>
        </label>
      </div>
      <Main
        musics={filtered}
        playlist={playlist}
        addToPlaylist={addToPlaylist}
        query={query}
      />
    </div>
  );
}

export default App;
